select beer, bar from serves 
except (

	select distinct s1.beer, s1.bar from (
	(select beer, bar from serves) as s1 
	join 
	(select beer, bar from serves) as s2 
	on s1.beer = s2.beer and s1.bar <> s2.bar)

	);

SELECT beer, bar FROM serves
EXCEPT
SELECT s1.beer,s1.bar FROM serves s1, serves s2 WHERE s1.beer = s2.beer AND s1.bar <> s2.bar;

SELECT beer, bar
FROM serves 
WHERE serves.beer in (SELECT beer FROM serves GROUP BY beer HAVING COUNT(beer) = 1);

select beer,bar from serves except 
(select s1.beer,s1.bar from serves as s1, serves as s2 where s1.bar <> s2.bar and s1.beer = s2.beer
);

(SELECT beer, bar FROM serves)

EXCEPT ALL

(SELECT s1.beer, s2.bar FROM serves as s1 CROSS JOIN serves as s2 WHERE s1.beer = s2.beer AND s1.bar <> s2.bar);

(select distinct beer, bar
from serves)
except
(select distinct s1.beer, s1.bar
from serves as s1, serves as s2
where s1.bar<>s2.bar and s1.beer=s2.beer);

SELECT beer, bar FROM serves WHERE beer IN (
  SELECT beer FROM serves GROUP BY beer HAVING COUNT(beer) = 1
);

(SELECT beer, bar FROM serves)

EXCEPT

(SELECT s1.beer, s1.bar FROM serves AS s1, serves AS s2 WHERE s1.bar <> s2.bar AND s1.beer = s2.beer);

SELECT beer, bar FROM serves s1 WHERE NOT exists (
  SELECT * FROM serves s2 WHERE
  s1.bar <> s2.bar AND
  s1.beer = s2.beer
);

(select distinct beer, bar from serves)
except 
(select distinct s1.beer, s1.bar from serves s1 join serves s2 on s1.bar<>s2.bar and s1.beer=s2.beer);
